import React, {Component} from 'react';
import GetAllWord from "../../components/DataDB/DataDB";

class LearnWords extends Component {
    componentDidMount() {
        GetAllWord().then(value => {
            this.setState({
                arrayWord: value
            });
        })
    }
    render() {
        return (
            <div>
                <p>123</p>
                <input type="text"/>
                <button>Change</button>
                <button>Check</button>
            </div>
        );
    }
}

export default LearnWords;
